border-left: none;
border-right: none;
border-bottom: 1px solid #6767AD;
font-size: 18px;
outline: none;
padding:20px;
margin:10px;
background: rgba(255, 255, 255, 0); 
color: #241F5D;
::placeholder{
    color:#6767AD;
}

`;


function FormArroundMe() {
	return <>


